import React from 'react';
import ImageGallery from 'react-image-gallery';
function ImageCarousel(props) {
  const images = [
      {
        original: '/images/221011_category_w_tops.jpeg',
        thumbnail: '221011_category_w_tops.jpeg',
      },
      {
        original: '221011_category_w_cardigan.jpeg',
        thumbnail: '221011_category_w_cardigan.jpeg'
      },
      {
        original: '221011_category_w_sweat.jpeg',
        thumbnail: '221011_category_w_sweat.jpeg'
      }
    ]

  return (
    <div>
  <ImageGallery items={images} />
    </div>
  );
}

export default ImageCarousel;
